import { authFalse, authTrue } from '../actions';

function Login () {
    let words = undefined;
    return (
        <div className="container">
            <div className="login">
                <h2>{words? words : 'Log In'}</h2>
                <form onSubmit={(e) => {
                    e.preventDefault();
                    const text = String(e.target[0].value);
                    console.log(text);
                    }
                }>
                    <input
                      type="text"
                      placeholder="Username"
                      name="username"
                      value={state.user}
                      onChange={handleChange}
                    />
                    <input
                      type="password"
                      placeholder="Password"
                      name="password"
                      value={state.password}
                      onChange={handleChange}
                    />
                    <input type="submit" value="Log In" className="button"/>
               </form>
            </div>
        </div>
    )
}

export default Login
